import Background from "../assets/Events.avif";

const Events = () => {
  return (
    <div>
      <div
        className="h-96 bg-fullcenter padding"
        style={{ backgroundImage: "url(" + Background + ")" }}
      >
        <h1>Events</h1>
      </div>
    </div>
  );
};

export default Events;
